import React from "react"
import classes from "./googlePlay.module.css"
import phone from "./img/phone.png"

const GooglePlay=()=>{
    return(
        <div className={classes.googlePlay}>
            <img alt="img" src={phone}/>
        </div>
    )
}
export default GooglePlay;
